fn map_to_ratio(baseline: Duration, mean: Duration) -> u64 {
    assert!(!baseline.is_zero());
    let mean = mean.as_nanos();
    let baseline = baseline.as_nanos();
    let ratio = mean / baseline;
    ratio as u64
}

